import { Button, Col, Row } from 'antd'
import React, { useState } from 'react'
import Pencil from '../../assets/img/iconos/edit-24px.svg'
import Delete from '../../assets/img/iconos/delete-24px.svg'

export default function Competencias(props) {
    const {data} = props;
    
    const [modalPassword, setModalPassword] = useState(false);
    const openModalPassword = () => {setModalPassword(true);}

    return (
        data.map((data,index) => 
        <Row key={index} gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }} className="rowSucursal" >
            <Col className="gutter-row nombresSucursal" id="nombresSucursal" style={{textAlign: "left", paddingLeft: "30px"}} span={14}>
                <span>{data.competencia}</span>
            </Col>
            <Col className="gutter-row direccionSucursal" id="direccionSucursal" span={4}>
                <span>{data.nivel}</span>
            </Col>

            <Col className="gutter-row" span={6}>
            
            <Button className="points" > <img alt="logo" onClick={openModalPassword} src={Pencil} width="18" height="18" /></Button>
            <Button className="points" > <img alt="logo" src={Delete} width="18" height="18" /></Button>
            
            </Col>
        </Row>
        )
    )
}
